import React from "react";
import Lottie from "lottie-react";
import animationData1 from "./animations/logos.json"; // Первая анимация
import animationData2 from "./animations/emoji.json"; // Вторая анимация

import "./Login.css";

const LoginAnimation = () => {
    return (
      <div className="animations-container">
        {/* Первая анимация */}
        <div className="animation-box first-animation">
          <Lottie 
            animationData={animationData1} 
            loop={true} 
            autoplay={true} 
            style={{ width: "100%", height: "100%" }} 
          />
        </div>
  
        {/* Вторая анимация */}
        <div className="animation-box second-animation">
          <Lottie 
            animationData={animationData2} 
            loop={true} 
            autoplay={true} 
            style={{ width: "100%", height: "100%" }} 
          />
        </div>
      </div>
    );
  };
  
  export default LoginAnimation;
